import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import SIFA from "../../assets/img/logos/SIFA FC.png"
import AU from "../../assets/img/logos/AU_LOGO_ENGLISH_CMYK.png"
import AUDA from "../../assets/img/logos/AUDA-NEPAD_LOGO_EN.png"
// import SIFA from 'src/assets/img/logos/SIFA FC.png'
// src\assets\img\logos\AU+NEPAD Logo.png

const Partners = () => {
    const logos = [
        { src : SIFA, alt: 'Sponsor 1' },
        { src : AU, alt: 'Sponsor 4' },
        { src : AUDA, alt: 'Sponsor 1' },
        { src : GERMANY, alt: 'Sponsor 1' },
        { src : EU, alt: 'Sponsor 1' },
        { src : KFW, alt: 'Sponsor 1' },
        { src : SWS, alt: 'Sponsor 1' },
        { src : TVETA, alt: 'Sponsor 1' },
        { src : ARSO, alt: 'Sponsor 1' },
        { src : FESTO, alt: 'Sponsor 1' },
        { src : SIEMENS, alt: 'Sponsor 1' },

    ]
  return (
    <Box className="bg-light py-5">
      <Box className="container">
        <Typography variant="h4" sx={{ color: '#1363C6', textAlign: 'center' }}>

          Partners
        </Typography>
        <Grid container spacing={5} justifyContent="center" alignItems="center" className="sponsor-logos mt-5">
            
          {logos.map((logo, index) => (
            <Grid item key={index} className="col-auto">
              <img
                src={logo.src}
                alt={logo.alt}
                className="sponsor-logo"
                style={{
                  width: '150px',
                  margin: '10px 30px',
                  padding: '50px 0',
                }}
              />
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
};

export default Partners;
